import { useState, useEffect } from "react";
import CompanyModal from "../../Common/CompanyModal";
import LoanIconButton from "../../../Common/LoanIconButton";
import { BsPlus } from "react-icons/bs";
import { IconButton } from "@material-tailwind/react";
import LoanTextField from "../../../Common/LoanTextField";
import {
  InputLabel,
  TextField,
  MenuItem,
  FormControl,
  Select,
} from "@mui/material";
import CommonServices from "../../Common/CommonServices";
const AddUnMarriedStatus = ({ SoleId }) => {
  const [submitted, setSubmitted] = useState(false);
  const [isCompanyMaritalStatusModalOpen, setIsCompanyMaritalStatusModalOpen] =
    useState(false);
  function handleGeneralCloseModal() {
    isCompanyMaritalStatusModalOpen(false);
  }
  function handleCompanyMaritalStatusCloseModal() {
    setIsCompanyMaritalStatusModalOpen(false);
  }
  const [toggleMarriedInfo, setToggleMarriedInfo] = useState(false);
  const initialMartailStatusUnmarriedState = {
    Id: null,
    SoleAndPartnerShipID: SoleId,
    DateOfWidowed: "",
    MarraigeCertificate: "",
    MarraigeCertificateIssuer: "",
    UnmarriedCertificate: "",
    UnmarraiedCertificateIssuer:"",
    UnmarriedCertificateIssuDate:"",
    UnmarriedCertificateExpiredDate:"",
    CourtDecision:"",
  };
  const [martailStatusUnmarried, setMartailStatusUnmarried] = useState(
    initialMartailStatusUnmarriedState
  );
  const newMartailStatusWidowed = () => {
    setMartailStatusWidowed(initialMartailStatusWidowedState);
    setSubmitted(false);
  };
  const handleInputChangeMartailStatusWidowed = (event) => {
    const { name, value } = event.target;
    setMartailStatusUnmarried({ ...martailStatusUnmarried, [name]: value });
  };
  const saveUnmarried = () => {
    var data = {
      SoleAndPartnerShipID: martailStatusUnmarried.SoleAndPartnerShipID,
      DateOfWidowed:martailStatusUnmarried.DateOfWidowed,
      MarraigeCertificate:martailStatusUnmarried.MarraigeCertificate,
MarraigeCertificateIssuer:martailStatusUnmarried.MarraigeCertificateIssuer,
UnmarriedCertificate:martailStatusUnmarried.UnmarriedCertificate,
UnmarraiedCertificateIssuer:martailStatusUnmarried.UnmarraiedCertificateIssuer,
UnmarriedCertificateIssuDate:martailStatusUnmarried.UnmarriedCertificateIssuDate,
UnmarriedCertificateExpiredDate:martailStatusUnmarried.UnmarriedCertificateExpiredDate,
CourtDecision:martailStatusUnmarried.CourtDecision,
    };
    CommonServices.UnmarriedSole(data, SoleId)
      .then((response) => {
        setMartailStatusUnmarried({
          Id: response.data.Id,
          SoleAndPartnerShipID: response.data.SoleAndPartnerShipID,
          UnMarriedCertficate: response.data.UnMarriedCertficate,
          UnMarriedCertficateIssueDate:
            response.data.UnMarriedCertficateIssueDate,
          UnMarriedCertficateExpiredDate:
            response.data.UnMarriedCertficateExpiredDate,
          UnMarriedCertficateIssuer: response.data.UnMarriedCertficateIssuer,
        });
        setSubmitted(true);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  return (
    <div>
      <button
        onClick={() => setToggleMarriedInfo(!toggleMarriedInfo)}
        className="text-purple-600 rounded-md font-medium "
      >
        Add Married
      </button>

      {toggleMarriedInfo && (
        <div className="submit-form">
          {submitted ? (
            <div>
              <h4>You submitted successfully!</h4>
            </div>
          ) : (
            <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
              <LoanTextField
                id="UnMarriedCertficate"
                label="UnMarriedCertficate"
                value={martailStatusUnmarried.UnMarriedCertficate}
                onChange={handleInputChangeMartailStatusUnmarried}
                name="UnMarriedCertficate"
              />
              <LoanTextField
                id="UnMarriedCertficateIssueDate"
                label="UnMarriedCertficateIssueDate"
                value={martailStatusUnmarried.UnMarriedCertficateIssueDate}
                onChange={handleInputChangeMartailStatusUnmarried}
                name="UnMarriedCertficateIssueDate"
              />
              <LoanTextField
                id="UnMarriedCertficateExpiredDate"
                label="UnMarriedCertficateExpiredDate"
                value={martailStatusUnmarried.UnMarriedCertficateExpiredDate}
                onChange={handleInputChangeMartailStatusUnmarried}
                name="UnMarriedCertficateExpiredDate"
              />
              <LoanTextField
                id="UnMarriedCertficateIssuer"
                label="UnMarriedCertficateIssuer"
                value={martailStatusUnmarried.UnMarriedCertficateIssuer}
                onChange={handleInputChangeMartailStatusUnmarried}
                name="UnMarriedCertficateIssuer"
              />
            </div>
          )}
          <div>
            <button
              className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              onClick={() => {
                saveUnmarried();
              }}
            >
              save
            </button>
          </div>
        </div>
      )}
    </div>
  );
};
export default AddUnMarriedStatus;
